var module = {};
module.exports = plotdb.chart.create({
  sample: function() {
    var list = d3.range(50);
    return {
      start: [{name: "Start Year", data: list.map(function(d,i) { 
        return new Date(parseInt(Math.random() * 100 + 1850)+"/1/1");
      })}],
      duration: [{name: "Duration", data: list.map(function(d,i) {
        return parseInt(Math.random() * 5 + 1.5 + (Math.random() > 0.5 ? Math.random() * 520: 10));
      })}],
      size: [{name: "Casualty", data: list.map(function(d,i) { return parseInt(Math.random() * 35 ) + 2})}],
      category: [{name: "Type", data: list.map(function(d,i) { return parseInt(Math.random() * 5); })}]
    };
  },
  dimension: {
    start: { type: [], require: true, desc: "start time of event" },
    duration: { type: [plotdb.Number], require: false, desc: "duration of event" },
    end: { type: [], require: false, desc: "end time of event (use this if you don't have duration field)" },
    size: { type: [plotdb.Number], require: true, desc: "size of event" },
    category: { type: [], require: true, desc: "category of event" },
  },
  config: {
    fontSize: { name: "Font Size", type: [plotdb.Number], default: 10 },
    padding: { name: "Padding", type: [plotdb.Number], default: 10 },
    margin: { name: "Margin", type: [plotdb.Number], default: 10 },
    palette: { name: "Palette", type: [plotdb.Palette], default: plotdb.Palette.default, 
             hint: plotdb.Palette.subtype.qualitative},
    color: { name: "Line Color", type: [plotdb.Color], default: plotdb.Color.default },
    thick: { name:"Line thickness", type: [plotdb.Number], default: 2 },
    maxRadius: { name: "Max Radius", type: [plotdb.Number], default: 40 },
    unit: { name: "Cluster Unit", type: [plotdb.Choice(["day","week","month"])], default: "month",
            rebindOnChange: true}
  },
  init: function() {
    var that = this;
    //this.debug = true;
    this.svg = d3.select(this.root).append("svg");
    this.colorLegendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.radiusLegendGroup = this.svg.append("g").attr({class: "legend-group"});
    this.xAxisGroup = this.svg.append("g").attr({class: "axis horizontal"});
    this.yAxisGroup = this.svg.append("g").attr({class: "axis vertical"});
    this.base = new Date("1970/1/1").getTime();
    this.popup = plotd3.html.popup(this.root).on("mousemove", function(d,i,popup) {
      popup.select(".title").text(d.category);
      popup.select(".value").text(d.size + " / " + (Math.round(100*d.duration)/100) + (" (" + that.config.unit+")"));
    });
  },
  parse: function() {
    var that = this;
    var buckethash = {
      day: [86400000, 86400000],
      week: [86400000 * 7, 86400000 * 7],
      month: [86400000 * 30, 86400000 * 30]
    };
    this.bucket = buckethash[this.config.unit][0];
    this.durbucket = buckethash[this.config.unit][1];
    this.data.map(function(d,i) {
      if(d.duration) d.duration = Math.round(86400000 * d.duration / that.durbucket);
      if(d.start && d.end) { 
        d.duration = Math.round((new Date(d.end).getTime() - new Date(d.start).getTime())/that.durbucket);
      }
      if(d.start) d.start = parseInt((new Date(d.start).getTime() - that.base) / that.bucket);
      if(d.end) {
        d.end = parseInt((new Date(d.end).getTime() - that.base) / that.bucket);
      }
    });
    var parsed = d3.nest().key(function(d,i) { return d.start; }).key(function(d,i) { return d.category; }).entries(this.data);
    var newdata = [];
    for(var i=0;i<parsed.length;i++) {
      for(var j=0,node,size,dur;j<parsed[i].values.length;j++) { 
        node = parsed[i].values[j];
        size = 0;
        dur = 0;
        for(var k=0;k<node.values.length;k++) {
          size += node.values[k].size;
          dur += node.values[k].duration;
        }
        dur = dur / (node.values.length || 1);
        newdata.push({size: size, duration: dur, category: node.key, start: parseInt(parsed[i].key)});
      }
    }
    this.data = newdata;
    this.startrange = d3.extent(this.data.map(function(it) { return it.start; }));
    this.endrange = d3.extent(this.data.map(function(it) { return it.start + it.duration; }));
    this.sizerange = d3.extent(this.data.map(function(it) { return it.size; }));
    this.durrange = d3.extent(this.data.map(function(it) { return it.duration; }));
    this.categories = d3.map(this.data, function(it) { return it.category; }).keys();
    this.data.map(function(d,i) {
      d.duration = (d.duration < 0.1 ? 0.1 : d.duration);
    });
    this.durrange[0] = 0.1;
  },
  bind: function() {
    if(this.debug) return;
    var that = this, sel;
    sel = this.svg.selectAll("path.connect").data(this.data);
    sel.exit().remove();
    sel.enter().append("path").attr({class: "connect", opacity: 1});
    sel = this.svg.selectAll("circle.area.data").data(this.data);
    sel.exit().remove();
    sel = sel.enter().append("circle").attr({class: "area data", opacity: 1});
    this.popup.nodes(sel);
  },
  resize: function() {
    if(this.debug) return;
    var that = this;
    var box = this.root.getBoundingClientRect();
    var width = this.width = box.width;
    var height = this.height = box.height;
    var f = this.config.fontSize;
    var m = this.config.margin;
    var p = this.config.padding;    
    this.svg.attr({
      width: width + "px", height: height + "px",
      viewBox: [0,0,width,height].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    this.popup.fontSize(this.config.fontSize);
    this.maxRadius = this.config.maxRadius;
    this.cscale = plotdb.Palette.scale.ordinal(this.config.palette);
    this.colorLegend = plotd3.rwd.legend().scale(this.cscale).orient("bottom")
      .fontSize(this.config.fontSize)
      .tickValues(this.categories)
      .size([this.width - this.config.margin * 4,this.height/2])
      .label(this.dimension.category.fieldName);
    this.colorLegendGroup.call(this.colorLegend).selectAll(".legend").on("mouseover", function(d,i) {
      that.activeGroup = d; that.render();
    }).on("mouseout", function(d,i) {
      that.activeGroup = null; that.render();
    });
    this.colorLegendSize = this.colorLegend.offset();
    this.rscale = d3.scale.linear()
      .domain([0, this.sizerange[1]])
      .range([1, this.maxRadius]);
    this.radiusLegend = plotd3.rwd.legend().scale(this.rscale).orient("bottom")
      .fontSize(this.config.fontSize).type("radius")
      .size([this.width/2 - this.config.margin * 2, this.height/2])
      .label(this.dimension.size.fieldName || " ");
    this.radiusLegendGroup.call(this.radiusLegend);
    this.radiusLegendSize = [0,0];//this.radiusLegend.offset();
    this.legendHeight = (this.colorLegendSize[1] > this.radiusLegendSize[1] ? this.colorLegendSize[1] : this.radiusLegendSize[1]);

    this.base = (isNaN(parseFloat(this.config.logbase)) || this.config.logbase < 1.1
      ? 1.1 : parseFloat(this.confi.logbase));
    this.xScale = d3.scale.linear()
      .domain([this.startrange[0], this.endrange[1]])
      .range([m, this.width - m - this.maxRadius]);
    this.xAxis = plotd3.rwd.axis().orient("bottom").scale(this.xScale).fontSize(this.config.fontSize);
    this.xAxis.tickFormat(function(d,i) {
      var d = new Date(d * that.bucket);
      return [d.getYear() + 1900,
       d.getMonth() + 1,
       d.getDate()].join("/");
    });
    this.xAxisGroup.call(this.xAxis);
    this.xAxisHeight = this.xAxis.offset() + this.config.fontSize * 1.5;
    this.yScale = d3.scale.log().base(this.base)
      .domain([0.1, 1, this.durrange[1]])
      .range([
        this.height - m - this.xAxisHeight - this.legendHeight,
        this.height - m - this.xAxisHeight - this.maxRadius - this.legendHeight,
        m + this.maxRadius
      ]);
    var len = parseInt(this.yScale.ticks().length/8);
    this.yTicks = this.yScale.ticks().filter(function(d,i) { return (i%len) == 0});
    this.yTicks = this.yTicks.filter(function(it) { return it >= 1; });
    this.yTicks = d3.map(this.yTicks.concat([0.1,1]),function(it) { return it; }).keys();
    this.yAxis = d3.svg.axis().scale(this.yScale).orient("left").tickValues(this.yTicks).tickFormat(d3.format(".1f"));
    this.yAxisGroup.call(this.yAxis).attr({"font-size": this.config.fontSize});
    var bbox = this.yAxisGroup[0][0].getBBox();
    this.yAxisWidth = bbox.width;
    this.xScale.range([this.yAxisWidth + m, this.width - m - this.maxRadius]);
    this.xAxisGroup.call(this.xAxis);
  },
  render: function() {
    var that = this;
    if(this.debug) return;
    var f = this.config.fontSize;
    var m = this.config.margin;
    var p = this.config.padding; 
    this.colorLegendGroup.attr({
      transform: ["translate(",
        (m + this.yAxisWidth),
        this.height - this.legendHeight - this.config.margin, ")"
      ].join(" ")
    });
    this.radiusLegendGroup.attr({
      opacity: 0,transform: ["translate(",
        (m + this.yAxisWidth + this.colorLegendSize[0] + this.config.fontSize * 3),
        this.height - this.legendHeight - this.config.margin, ")"
      ].join(" ")
    });
    this.xAxisGroup.attr({transform: "translate(0, "+ ( this.height - this.xAxisHeight - m - this.legendHeight ) + ")" });
    this.yAxisGroup.attr({transform: "translate(" + ( this.yAxisWidth + m ) + ",0)" });
    this.svg.selectAll("path.connect").attr({
      d: function(d,i) {
        var x1 = that.xScale(d.start);
        var x2 = that.xScale(d.start + d.duration);
        var y1 = that.yScale(0.1);
        var y2 = that.yScale(d.duration) + that.rscale(d.size);
        var cy1 = (y1 * 2 + y2 ) / 3;
        var cy2 = (y1 + 2 * y2 ) / 3;
        return [
          "M", x1, y1,
          "C", x1, cy1, x2, cy2, x2, y2
        ].join(" ");
      },
      fill: "none",
      stroke: this.config.color,
      "stroke-width": this.config.thick
    }).transition().attr({
      opacity: function(d,i) { return (!that.activeGroup || that.activeGroup == d.category ? 1 : 0.1) }
    });
    this.svg.selectAll("circle.data.area").attr({
      cx: function(d,i) { return that.xScale(d.start + d.duration); },
      cy: function(d,i) { return that.yScale(d.duration); },
      r: function(d,i)  { return that.rscale(d.size); },
      fill: function(d,i) { return that.cscale(d.category); },
      opacity: 0.8,
      stroke: this.config.color,
      "stroke-width": this.config.thicl
    }).transition().attr({
      opacity: function(d,i) { return (!that.activeGroup || that.activeGroup == d.category ? 1 : 0.1) }
    });;
  }
});
